import React from 'react'

class App extends React.Component{
    constructor(){
        super()
        this.state = {
            fName: '',
            lname: '',
            name: '',
            placeOfBirth: '',
            phone: '',
            favoriteFood: '',
            email: ''
        }
    }

    render(){
        return(
            <div className='app-container'>
                <form className='form-container'>
                    <input className='fName' placeholder='First Name' name='fName'></input>
                    <input className='lName' placeholder='Last Name' name='lName'></input>
                    <input className='email' placeholder='email' name='email'></input>
                    <input className='place-of-birth' placeholder='Place of Birth' name='placeOfBirth'></input>
                    <input className='phone' placeholder='Phone Number'></input>
                    <input className='favorite-food' placeholder='Favorite Food'></input>
                    <input className='about-yourself' placeholder='Tell us about yourself . . .'></input>
                </form>
            </div>
        )
    }
}

export default App
